import React from 'react';
import Header from '../Header/Header';
import './Home.css'

const Home = () => {
  return (
    <>
      <Header />

      <div
        className="maindiv"
        style={{
          backgroundImage: `url(${process.env.PUBLIC_URL}/3.jpg)`,
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          height: '600px',
          width: '100%',
          marginTop: '-19px',
        }}
      >
        <h3 style={{ color: 'white', fontSize: '2.5rem', marginBottom: '1rem' }}>Non - Profit Organization</h3>
        <p style={{ color: 'white', fontSize: '1.5rem' }}>Every charitable act is a stepping stone towards heaven</p>
      </div>

      <div className="seconddiv" style={{ height: '600px', width: '100%', backgroundColor: 'aliceblue', marginTop: '-43px' }}>
        <h3 style={{ color: '#683d4a', fontSize: '2.5rem', textAlign: 'center' }}>We are the worldâ€™s No 1 fundraising site for charitable causes</h3>
        <div className="card-container">
          <div className="card">
            <img src={process.env.PUBLIC_URL + '/Donation.png'} style={{ maxWidth: '100%', maxHeight: '100%' }} alt="Logo 1" />
            <h4>Card 1</h4>
          </div>
          <div className="card">
            <img src={process.env.PUBLIC_URL + '/volunteer.png'} style={{ maxWidth: '100%', maxHeight: '100%', background }} alt="Logo 2" />
            <h4>Card 2</h4>
          </div>
          <div className="card">
            <img src={process.env.PUBLIC_URL + '/logo3.png'} alt="Logo 3" />
            <h4>Card 3</h4>
          </div>
        </div>
      </div>

      {/* The rest of your app */}
    </>
  );
};

export default Home;
